import APIKey from "./constant";

async function fetchIngredient(ingredient) {
  const response = await fetch(
    `https://api.spoonacular.com/food/ingredients/search?apiKey=${APIKey}query=banana&number=1&sort=calories&sortDirection=desc`
  );
}

export { fetchIngredient };
